#include <map> 
#include <vector> 
#include <list> 
#include <string> 
#include <set> 
#include <bitset> 
#include <algorithm> 
#include <numeric> 
#include <sstream> 
#include <iostream> 
using namespace std; 
#include <math.h> 
 
#ifdef __GNUC__ 
    #define __int64 long long 
#endif 
 
class StringTrain 
{ 
public: 
    string buildTrain(vector <string> cars) 
    { 
        string train = cars[0]; 
        int n = cars.size(); 
        for (int i = 1; i < n; ++i) 
        { 
            sufapp(train, cars[i]); 
        } 
        int l = train.length(); 
        string final = ""; 
        for (int i = 0; i < l; ++i) 
        { 
            char c = train[i]; 
            int k = train.find_last_of(c); 
            if (i == k) 
                final += c; 
        } 
        stringstream s; 
        s << l << ' ' << final; 
        return s.str(); 
    } 
     
private: 
    void sufapp(string& orig, string targ) 
    { 
        int n = orig.length(); 
        int l = targ.length(); 
        int b = n - (l - 1); 
        for (int i = l - 1; i > 0; --i) 
        { 
            string pre = targ.substr(0, i); 
            if (b > 0) 
            { 
                string suf = orig.substr(b, i); 
                if (suf == pre) 
                { 
                    orig += targ.substr(i, l - i); 
                    return; 
                } 
            } 
            b++; 
        } 
    } 
 
}; 
 
 
